pragma solidity ^0.8.0;


contract fixedsizearray{

    string status;
    uint[] arr = [10, 20, 30, 40, 50];
    // uint[] arr;

    function getarr() public view returns(uint[] memory){
        return arr;
    }

    function getstatus() public view returns(string memory){
        return status;
    }

    function getArrayLength() public view returns(uint){
        return arr.length;
    }




    // function uint2str(uint i) internal pure returns (string){
    //     if (i == 0) return "0";
    //     uint j = i;
    //     uint length;
    //     while (j != 0){
    //         length++;
    //         j /= 10;
    //     }
    //     bytes memory bstr = new bytes(length);
    //     uint k = length - 1;
    //     while (i != 0){
    //         bstr[k--] = byte(48 + i % 10);
    //         i /= 10;
    //     }
    //     return string(bstr);
    // }

    function updatearr(uint _pos, uint _value) public{
        status = "ABABAB";
        if(arr.length  > _pos){
            arr[_pos] = _value;
            status = "update existing string";
        }else{
            for(uint i = arr.length; i<=_pos; i++){
                if(arr.length-1 != _pos){
                    arr.push(0);
                }else{
                 arr.push(_value);   
                }                
            }
            status="In Else Condition";
        } 
    }

    function getupdate() public view returns(string memory){
        return status;
    }

    function simpleoushinarr() public{
        arr.push(123);
    }

    function pushnum() public view returns(uint[] memory){
        // arr.push(123);
        return arr;
    }
}

